import React from "react";
import { Form } from "react-bootstrap";

function Appraisal() {
    return (
        <div>
            <Form>
                <div>
                    <label htmlFor="name">Name:</label>
                </div>
            </Form>
        </div>
    );
}

export default Appraisal;
